column8:
　自分撮りスティックで、旅行などでも自分で簡単に写真を撮ることができます。スマホホルダー付きなので、各種スマホを固定して使用できます。デジタルカメラや、ビデオカメラも取り付け可能！（大型の一眼レフやミレーレスなど、重量がある物はお控えくださいませ。）<br>
<br>
※こちらの商品を使用中に、端末の落下等の故障は、いかなる理由でも保障は一切できませんので、ご了承の上ご注文及び、ご使用をお願い致します。 <br>
<br>
<font color="ff0000">注：定形外郵便送料無料に設定されている商品となりますが、代金引換ご希望の場合は、代引き手数料420円と、別途宅配便送料550円となります。<br>
（システム上ご注文確定後に、当店より返信メール時に送料550円が加算されます。）<br>
また、お急ぎの場合や、宅配便ご希望のお客様は、ご注文時の備考欄に宅配便希望とお書きくださいませ。<br>
ご注文確定後に、当店にて送料550円に変更して、宅配便にて発送させて頂きます。 <br></font><style type="text/css"> 
